<script type='text/javascript'>

function prepare() {
    LMSInitialize() ;   
    new SLM(document.getElementById('content'),0,null,null);
} 

function finish() {
    if (!isfinished){
        isfinished = true;
        LMSFinish();
    }
}

var isfinished = false;
onunload = finish;

</script>
